import React, {Component} from 'react';

class NotFound extends Component {

    render() {
        return (
            <div className="text-center">
                <h1>Oops!</h1>
                <h2>Esta página não foi encontrada...</h2>
            </div>
        );
    }
}

export default NotFound;
